import React from "react";
import { MediumTitle, SmallTitle } from "../../theme/style/style";
import styled from "styled-components";
import AppBar from "./components/AppBar/AppBar";
import { makeStyles } from "@material-ui/core/styles";
import focus from "../../theme/icons/focus.png";
console.log(focus); // /logo.84287d09.png

const useStyles = makeStyles((theme) => ({
  logo: {
    display: "flex",
  },
  mediumTitle: {
    fontWeight: 100,
    fontSize: "3rem",
    marginBottom: "2rem"
  },
  smallTitle: {
    fontSize: "1.6rem",
    marginBottom: "2rem"
  },
}));

const Container = styled.div`
  min-height: 100vh;
`;

const Wrapper = styled.div`
  height: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const SmallContainer = styled.div`
  position: absolute;
  top: 40%;
  left: 0;
  right: 0;
  transform: translateY(-50%);
  text-align: center;

  @media (max-width: 768px) {
    top: 8vh;
    transform: translateY(0);
  }

  @media (max-width: 576px) {
    top: 10vh;
  }
`;

export default function ({ navigate }) {
  const name = "user";
  const classes = useStyles();

  return (
    <Container>
      <AppBar />
      <Wrapper>
        <SmallContainer>
          <MediumTitle className={classes.mediumTitle}>
            Welcome, <strong className={classes.strong}>{name}</strong>
          </MediumTitle>
          <SmallTitle className={classes.smallTitle}>
            Let's get started!
          </SmallTitle>
          {/* <CardsContainer>{themes}</CardsContainer> */}
        </SmallContainer>
      </Wrapper>
    </Container>
  );
}
